  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset is a subset of the Unified
  Map representing Coral reef and Hardbottom areas. Version 1.1 - December 2013. The
  Unified Florida Reef Tract Map (Unified Reef Map) provides a consistent geospatial
  framework for management, monitoring, and characterization of the Florida reef tract
  from Martin County to the Dry Tortugas. The Unified Reef Map integrates existing
  benthic habitat maps of Martin, Palm Beach, Broward, and Miami Counties, Biscayne
  National Park, Florida Bay, and the Florida Keys, including the Dry Tortugas. This
  map of the seafloor uses a Unified Classification (UC) system to provide a common
  and consistent picture of the entire area while retaining the original detailed
  information specific to different source maps. The UC contains five levels of seafloor
  classification detail providing flexibility in the scope of analysis. UC Level 0
  is the coarsest classification level that provides a consistent view of the entire
  area. UC Level 4 retains full seafloor description details from source maps which
  are not necessarily consistent for all areas. Where mapping projects spatially overlap,
  data are edited to create a seamless and consistent transition. Existing seafloor
  classification values are also cross-walked to the Coastal and Marine Ecological
  Classification Standard (CMECS).\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
